INSERT INTO plantillas_resoluciones (id, nombre, plantilla, identificador, tipo_resolucion, estados_permitidos, estado_cambio, resoluciones_creadas, cargo_firma, firma_ciudadano) VALUES
(7, 'Oficio de notificación', '<div title=\"Page 1\">\r\n<div title=\"Page 1\">\r\n<div>\r\n<div>\r\n<div>\r\n<p style=\"text-align: center;\"><strong>OFICIO DE NOTIFICACI&Oacute;N DE COBRO PERSUASIVO</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div title=\"Page 1\">\r\n<div>\r\n<div>\r\n<div>\r\n<p style=\"text-align: right;\">AL CONTESTAR CITE ESTE NUMERO:</p>\r\n<p style=\"text-align: right;\"><strong>CE-1-2023</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>Señor(a):</p>\r\n<p>{{nombre_ciudadano}}</p>\r\n<p>{{direccion_ciudadano}}</p>\r\n<p>{{ciudad_ciudadano}}</p>\r\n</div>\r\n<p><strong>REF.: COMPARENDO No.</strong>&nbsp;4718900000000{{comparendo}} de fecha {{fecha_comparendo}}</p>\r\n<p>Cordial saludo,</p>\r\n<p style=\"text-align: justify;\">De manera comedida me permito informar que mediante resoluci&oacute;n de la referencia fue declarado contraventor por la infracci&oacute;n identificada con el c&oacute;digo {{codigo_infraccion}} que describe {{infraccion_descripcion}}. haci&eacute;ndose acreedor de la multa por valor de {{valor_comparendo_letras}} MCTE ({{valor_comparendo}}) m&aacute;s los intereses moratorios que se causen a la fecha de pago, gastos de cobranza y honorarios.</p>\r\n<p style=\"text-align: justify;\">En consecuencia, y con el fin de evitarle molestias en tramites posteriores ante las autoridades de tr&aacute;nsito, mayores costos que puedan llevar incluso al embargo de sus bienes, reporte en DATA CREDITO o como deudor Fiscal del Estado lo invito a que se acerque a el Instituto de Tr&aacute;nsito y Transporte Municipal de Ci&eacute;naga Magdalena - INTRACIENAGA. para que pague lo adeudado o realice acuerdo de pago.</p>\r\n<p style=\"text-align: justify;\">Por el respeto a su vida, la de sus pasajeros y la de los peatones. No m&aacute;s Excusas,&nbsp;<strong><span style=\"text-decoration: underline;\">USA LA INTELIGENCIA VIAL</span></strong>. Si ya realizo el pago o suscribi&oacute; acuerdo de pago y est&aacute; al d&iacute;a, haga caso omiso de esta notificaci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Dado en Cienaga, {{fecha_actual_letras}}.</p>', 'oficio_notificacion', 8, '1,3,6,11', 0, 0, 'INSPECTOR DE TRANSITO', 1),
(8, 'Audiencia con contraventor', '<div title=\"Page 1\">\n<div>\n<div>\n<div>\n<p style=\"text-align: center;\"><strong>RESOLUCION No. 1930 DE 2023</strong></p>\n<p>Por la cual se realiza la audiencia dentro del proceso contravencional seguido al señor(a) {{nombre_ciudadano}}, identificado con Cedula de ciudadania No. {{identificacion_ciudadano}}&nbsp;por el comparendo No. 9999999900000{{comparendo}} de {{fecha_comparendo_letras}}.</p>\n<p>El(a) JUEZ DE EJECUCION FISCAL de el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA en uso de sus facultades legales y en especial las conferidas por la Ley 769 de 2002 y 1383 de 2010.</p>\n<p style=\"text-align: center;\"><strong>CONSIDERANDO</strong></p>\n<p>Que el presunto contraventor {{nombre_ciudadano}}, identificado con Cedula de ciudadania No. {{identificacion_ciudadano}}, solicita al despacho el día concederle audiencia toda vez, que no esta deacuerdo con la la infracción&nbsp; {{codigo_infraccion}} - {{infraccion_descripcion}}.</p>\n<p>De conformidad a la Ley 769 de 2002 Artículo 136. Modificado Artículo 24 Ley 1383 de 2010, Modificado Artículo 205 Decreto-Ley 19 de 2012, con la finalidad de la preservación y la defensa del presunto infractor el señor {{nombre_ciudadano}}identificado con la Cedula de ciudadania No {{identificacion_ciudadano}}, se le concede su petición de realización de audiencia, concediéndole el uso de la palabra para que realice una narración clara y sucinta de los hechos.</p>\n<p>NARRACION DE LOS HECHOS</p>\n<p>RESPECTO A LAS PRUEBAS PETICIONADAS Y DECLARADAS DE OFICIO:</p>\n<p>En este estado de la diligencia siendo las se suspende la presente audiencia, para ser continuada para práctica de pruebas el día .</p>\n<p>RESUELVE ARTICULO PRIMERO: Fijar como fecha para la audiencia el día .</p>\n<p>ARTICULOS SEGUNDO: se Decretan por ser conducentes y pertinentes las siguientes pruebas: ARTICULO TERCERO: expídanse los oficios de requerimiento pertinentes.</p>\n</div>\n</div>\n<div>\n<div>\n<p>Dada en Cienaga, el {{fecha_actual_letras}}.</p>\n</div>\n</div>\n</div>\n</div>', 'audiencia_contraventor', 6, '1,8,16', 8, 0, '', 0),
(9, 'Constancia no presentación', '<div title=\"Page 1\">\r\n<div>\r\n<div>\r\n<div>\r\n<p style=\"text-align: center;\"><strong>AUTO No. 2023-1-</strong><br><strong>FIJA FECHA DE AUDIENCIA</strong></p>\r\n<p style=\"text-align: justify;\">Por la cual se fija fecha de audiencia pública dentro del proceso contravencional seguido al señor(a) {{nombre_ciudadano}} identificado con {{tipo_identificacion}} No {{identificacion_ciudadano}} por el comparendo No. 471890000000{{comparendo}} de {{fecha_comparendo}} vehículo de placas {{placa}} .</p>\r\n<p style=\"text-align: justify;\">El(a) JUEZ DE EJECUCION FISCAL de el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA en uso de sus facultades legales y en especial las conferidas por la Ley 769 de 2002 y 1383 de 2010.</p>\r\n<p style=\"text-align: center;\"><strong>CONSIDERANDO</strong></p>\r\n<p style=\"text-align: justify;\">Que transcurrido el plazo determinado por ley desde la fecha en que se extendió la orden de comparecencia No. 471890000000{{comparendo}} de {{fecha_comparendo}} el (la) señor (a) {{nombre_ciudadano}} con {{tipo_identificacion}} No {{identificacion_ciudadano}}, conductor (a) del vehículo de placas {{placa}} , no se ha presentado al despacho ni a justificado su inasistencia, de tal conducta pasiva se deduce que no es su interés acogerse a los derechos que la ley le concede.</p>\r\n<p style=\"text-align: justify;\">Como quiera que el inculpado (a) no compareció, tendrá oportunidad de hacerlo dentro de los treinta (30) días hábiles siguientes a la fecha de la imposición del comparendo, entendiéndose que queda vinculado (a) al proceso y la multa por la infracción código {{codigo_infraccion}}&nbsp;esto es por las presuntas faltas de {{infraccion_descripcion}}, de quedar en firme, sera por el valor de {{valor_comparendo_letras}}&nbsp;MCTE (${{valor_comparendo}}) y se sujetara a lo previsto en el Capítulo II del Título IV de la Ley 1383 del 16 de marzo de 2010, y a las consecuencias que de ello deriven como lo establece también el inciso segundo del artículo 23 ibídem y demás normas concordantes. En este estado de la diligencia la presente audiencia pública se suspende para ser continuada el día {{fecha_30_habiles_letras}}&nbsp;treinta y unavo hábil siguiente a la fecha de imposición de la Orden de Comparendo. Para efectos del Artículo 161, espiden, esta diligencia corresponde a la celebración efectiva de la audiencia, notificándose en estrados (artículo 139 Ley 769 de 2002).</p>\r\n<p style=\"text-align: justify;\"><strong>RESUELVE</strong></p>\r\n<p style=\"text-align: justify;\"><br><strong>ARTICULO PRIMERO:</strong> FIJAR como fecha para continuar la audiencia el día {{fecha_30_habiles_letras}}&nbsp;.</p>\r\n<p style=\"text-align: justify;\"><strong>ARTICULO SEGUNDO:</strong> Contra el presente auto no proceden recursos.<br>Una vez leída y aprobada, se firma por los que en ella intervinieron el {{fecha_actual_letras}}.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'constancia_no_presentacion', 5, '1', 0, 0, 'Abogada', 0),
(10, 'Audiencia', '<div title=\"Page 1\">\n<div>\n<div>\n<div>\n<p style=\"text-align: center;\"><strong>RESOLUCION No. 1930 DE 2023</strong></p>\n<p>Por la cual se realiza la audiencia dentro del proceso contravencional seguido al señor(a) {{nombre_ciudadano}}, identificado con Cedula de ciudadania No. {{identificacion_ciudadano}}&nbsp;por el comparendo No. 9999999900000{{comparendo}} de fecha {{fecha_comparendo}}.</p>\n<p>El(a) JUEZ DE EJECUCION FISCAL de el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA en uso de sus facultades legales y en especial las conferidas por la Ley 769 de 2002 y 1383 de 2010.</p>\n<p style=\"text-align: center;\"><strong>CONSIDERANDO</strong></p>\n<p>Que el presunto contraventor {{nombre_ciudadano}}, identificado con Cedula de ciudadania No. {{identificacion_ciudadano}}, solicita al despacho el día concederle audiencia toda vez, que no esta deacuerdo con la la infracción {{codigo_infraccion}} - {{infraccion_descripcion}}</p>\n<p>De conformidad a la Ley 769 de 2002 Artículo 136. Modificado Artículo 24 Ley 1383 de 2010, Modificado Artículo 205 Decreto-Ley 19 de 2012, con la finalidad de la preservación y la defensa del presunto infractor el señor {{nombre_ciudadano}}&nbsp;identificado con la Cedula de ciudadania No {{identificacion_ciudadano}}, se le concede su petición de realización de audiencia, concediéndole el uso de la palabra para que realice una narración clara y sucinta de los hechos.</p>\n<p style=\"text-align: center;\"><strong>NARRACION DE LOS HECHOS</strong></p>\n<p style=\"text-align: center;\"><strong>RESPECTO A LAS PRUEBAS PETICIONADAS Y DECLARADAS DE OFICIO:</strong></p>\n<p>En este estado de la diligencia siendo las se suspende la presente audiencia, para ser continuada para práctica de pruebas el día .</p>\n<p style=\"text-align: center;\"><strong>RESUELVE</strong></p>\n<p><strong>&nbsp;ARTICULO PRIMERO:</strong> Fijar como fecha para la audiencia el día <span style=\"color: rgb(224, 62, 45);\"><strong>FECHA</strong></span>.</p>\n<p><strong>ARTICULOS SEGUNDO: </strong>se Decretan por ser conducentes y pertinentes las siguientes pruebas: ARTICULO TERCERO: expídanse los oficios de requerimiento pertinentes.</p>\n</div>\n</div>\n<div>\n<div>\n<p>Dada en Cienaga, el <span style=\"color: rgb(224, 62, 45);\"><strong>FECHA</strong></span>.</p>\n</div>\n</div>\n</div>\n</div>', 'audiencia', 6, '1,6', 6, 0, '', 0),
(11, 'Mandamientos de pago', '<div title=\"Page 1\">\r\n<p style=\"text-align: center;\"><strong>AUTO DE MANDAMIENTO DE PAGO No. {{ano}}-14932565-MP </strong></p>\r\n<p style=\"text-align: center;\"><strong>{{fecha_actual}}</strong></p>\r\n<p style=\"text-align: center;\"><strong>LA JEFE DE LA OFICINA JURÍDICA CON FUNCIONES DE EJECUTOR</strong></p>\r\n<p style=\"text-align: center;\"><strong>FISCAL PARA COMPARENDOS ELECTRÓNICOS</strong> DEL <strong>INSTITUTO DE TRÁNSITO Y TRANSPORTE MUNICIPAL DE CIÉNAGA MAGDALENA - INTRACIENAGA.</strong></p>\r\n<p style=\"text-align: justify;\">En uso de sus atribuciones legales y reglamentarias, en especial las conferidas en el Acuerdo 010 de 2017, los artículos 140 y 159 del Código Nacional de Transito Ley 769 de 2002, el artículo 5&deg; de la ley 1066 de 2006, Estatuto Tributario Nacional y Normas Complementarias y,</p>\r\n<p style=\"text-align: center;\"><strong>CONSIDERANDO:</strong></p>\r\n<p style=\"text-align: justify;\">Que de conformidad con los artículos 98 y 99 del Código de Procedimiento Administrativo y de lo Contencioso Administrativo, PRESTA MERITO EJECUTIVO POR JURISDICCION COACTIVA, todo acto administrativo ejecutoriado que imponga a favor de una entidad territorial, la obligación de pagar una suma liquida de dinero en los casos previstos en la ley.</p>\r\n<p style=\"text-align: justify;\">Que obra al despacho de la Oficina de jurisdicción coactiva, para su cobro la Resolución No. <strong>{{ano_comparendo}}-{{comparendo}}-SA de {{fecha_comparendo}}</strong>, donde resolvió imponer obligación pecuniaria al (a) señor(a) <strong>{{nombre_ciudadano}}</strong>&nbsp;identificado(a) con la Cedula de ciudadania No. <strong>{{identificacion_ciudadano}}</strong>, por valor de <strong>{{valor_comparendo_letras}}</strong> MCTE (<strong>${{valor_comparendo}}</strong>) teniendo como antecedente lo informado por la autoridad de control de tránsito en la vía con el comparendo No. <strong>4718900000000{{comparendo}}</strong> de fecha <strong>{{fecha_comparendo}}</strong>.</p>\r\n<p style=\"text-align: justify;\">Que la mencionada decisión, la cual quedó en firme según se hizo constar por el funcionario competente, constituye un acto administrativo ejecutoriado que impone a favor del Municipio de la el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA, la obligación de pagar una suma líquida en dinero.</p>\r\n<p style=\"text-align: justify;\">Que así las cosa existe una obligación clara, expresa y actualmente exigible, ejecutable el procedimiento de cobro coactivo administrativo previsto en los arts. 823 y siguientes del Estatuto Tributario, conforme lo dispone el art. 5&deg; de la ley 1066 de 2006.</p>\r\n<p style=\"text-align: justify;\">En mérito de lo expuesto, el el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA</p>\r\n<p style=\"text-align: center;\"><strong>RESUELVE:</strong></p>\r\n<p style=\"text-align: justify;\"><strong>PRIMERO:</strong> Librar mandamiento de pago por la vía administrativa coactiva, por valor de <strong>{{valor_comparendo_letras}}</strong> MCTE (<strong>{{valor_comparendo}}</strong>), más los intereses moratorios que se causen y demás erogaciones causadas con ocasión al presente proceso. hasta cuando se verifique su pago efectivo, contra el señor(a) <strong>{{ciudadano_nombre}} </strong>identificado(a) con la&nbsp;Cedula de ciudadania No. <strong>{{identificacion_ciudadano}}</strong>, y a favor de el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA, por concepto de la obligación pecuniaria contenida en la Resolución No. <strong>{{ano_comparendo}}-{{comparendo}}-SA</strong> de <strong>{{ano_comparendo}}&nbsp;</strong>teniendo como antecedente lo informado por la autoridad de control de tránsito en la vía con el comparendo No. <strong>4718900000000{{comparendo}}</strong> de fecha <strong>{{fecha_comparendo}}</strong>.</p>\r\n</div>\r\n<div title=\"Page 2\">\r\n<p style=\"text-align: justify;\"><strong>SEGUNDO:</strong> Decretar el embargo de los bienes de cualquier naturaleza de titularidad del contraventor, así como los bienes Inmuebles, muebles, vehículos, saldos bancarios, depósitos de ahorro, títulos de contenido crediticio o cualquier valor de que sea titular o beneficiario; por lo cual se deberá oficiar a las entidades respectivas, a efectos de que procedan de conformidad, acorde lo prevé el artículo 839-1 del Estatuto Tributario, adicionado por la Ley 6 de 1992, artículo 86.</p>\r\n<p style=\"text-align: justify;\"><strong>TERCERO: </strong>Ofíciese a a la totalidad de entidades financieras, para que a través de ella, se haga efectivo el embargo en cada una de las oficinas o sucursales del país en donde tenga cuentas o valores el ejecutado y a las entidades encargadas de llevar registros de bienes muebles e inmuebles, para que rindan información a esta dependencia de conformidad con el numeral anterior, de los bienes de propiedad del aquí ejecutado, advirtiendo que el término para allegar dicha información es el contenido en el Art. 30 de la Ley 1437 de 2011.</p>\r\n<p style=\"text-align: justify;\"><strong>CUARTO:</strong> Notifíquese el presente mandamiento ejecutivo al ejecutado, en la forma establecida en el artículo 826 del Estatuto Tributario.</p>\r\n<p style=\"text-align: justify;\"><strong>QUINTO: </strong>Contra la presente resolución no procede ningún recurso, conforme lo establece el art. 833-1 del Estatuto Tributario.</p>\r\n<p style=\"text-align: justify;\"><strong>SEXTO:</strong> Dentro de los quince (15) días siguientes a la notificación del mandamiento de pago, el ejecutado deberá cancelar el monto de la deuda con sus respectivos intereses, o podrá proponer mediante escrito cualquiera de las excepciones contempladas en el artículo 831 del Estatuto Tributario.</p>\r\n<p style=\"text-align: center;\"><strong>NOTIFIQUESE Y CUMPLASE</strong></p>\r\n<p>Dada en Cienaga, el {{fecha_actual_letras}}.</p>\r\n<p>&nbsp;</p>\r\n</div>', 'mandamientos_pago', 16, '1', 11, 0, '', 0),
(12, 'Fallo Audiencia', '<div title=\"Page 1\">\r\n<p style=\"text-align: center;\"><strong>RESOLUCION No. 18007 DE 2023</strong></p>\r\n<p style=\"text-align: justify;\">Por la cual se profiere fallo dentro del proceso contravencional seguido al señor(a) <strong>{{nombre_ciudadano}}</strong>, identificado con Cedula de ciudadania No. <strong>{{identificacion_ciudadano}}</strong> por el comparendo No. <strong>471890000000{{comparando}}</strong> de fecha <strong>{{fecha_comparendo_letras}}</strong>.</p>\r\n<p style=\"text-align: justify;\">El(a) JUEZ DE EJECUCION FISCAL de el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA en uso de sus facultades legales y en especial las conferidas por la Ley 769 de 2002 y 1383 de 2010.</p>\r\n<p style=\"text-align: center;\"><strong>CONSIDERANDO</strong></p>\r\n<p style=\"text-align: justify;\">Que el señor(a) <strong>{{nombre_ciudadano}}</strong>, identificado con Cedula de ciudadania No. {{identificacion_ciudadano}}, solicito AUDIENCIA PUBLICA, dentro de los cinco días siguientes a la imposición del comparendo, por la presunta comisión de infracción codificada bajo el código</p>\r\n<p style=\"text-align: justify;\"><strong>{{codigo_infraccion}} - {{infraccion_descripcion}}</strong>, de la resolución 003027 de 2010. Bajo los hechos expuestos por el presunto&nbsp;contraventor, las pruebas decretadas de oficio, solicitadas y practicadas en audiencia, se procede a llevar a cabo el análisis probatorio de las mismas. De conformidad a la Ley 769 de 2002 modificada por la Ley 1383 del 2010, con la finalidad de la preservación de los derechos del presunto infractor el señor(a) <strong>{{nombre_ciudadano}}</strong>, identificado con Cedula de ciudadania No. {{identificacion_ciudadano}}.</p>\r\n<p style=\"text-align: center;\"><strong>HECHOS</strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: rgb(224, 62, 45);\">ESCRIBA AQU&Iacute; LOS HECHOS</span></p>\r\n<p style=\"text-align: center;\"><strong>ARGUMENTOS DE DEFENSA, PRACTICA DE PRUEBAS Y ANALISIS PROBATORIO</strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: rgb(224, 62, 45);\">AQU&Iacute;&nbsp;EL ARGUMENTO</span></p>\r\n<p style=\"text-align: center;\"><strong>CONSIDERACIONES DEL DESPACHO (FUNDAMENTOS DE DERECHO)</strong></p>\r\n<p style=\"text-align: justify;\">En lo referente al comparendo No <strong>471890000000{{comparendo}}</strong> por la infracción código <strong>{{codigo_infraccion}}</strong> esto por las presuntas faltas de {{infraccion_descripcion}}, este despacho procede a valorar las pruebas aportadas a la luz de la norma Código Nacional de Transito:</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: rgb(224, 62, 45);\">AQU&Iacute;&nbsp;CONSIDERACINES DEL DESPACHO</span></p>\r\n<p style=\"text-align: justify;\">En consecuencia se declara probados los hechos se impondrá la multa descrita para el código de infracción&nbsp; <strong>{{codigo_infraccion}}</strong> por valor de <strong>{{valor_comparendo_letras}}</strong> <strong>PESOS MCTE </strong>(<strong>${{valor_comparendo}}</strong>).</p>\r\n<p style=\"text-align: justify;\">Por lo brevemente expuesto, este despacho.</p>\r\n<p style=\"text-align: center;\"><strong>RESUELVE</strong></p>\r\n</div>\r\n<div title=\"Page 2\">\r\n<div>\r\n<p style=\"text-align: justify;\"><strong>ARTICULO PRIMERO:</strong> Declarar probados los hechos descritos en el código de infracción <strong>{{codigo_infraccion}}</strong>&nbsp;por parte del señor(a) <strong>{{nombre_ciudadano}}</strong>, identificado con Cedula de ciudadania No. <strong>{{identificacion_ciudadano}}</strong>. Informada mediante orden de comparecencia <strong>471890000000{{comparendo}}</strong> de fecha <strong>{{fecha_comparendo_letras}}</strong>. Como se dejo expreso en la parte motiva de este acto.</p>\r\n<p style=\"text-align: justify;\"><strong>ARTICULO SEGUNDO:</strong> Declararlo CONTRAVENTOR de la norma de tránsito al señor(a) <strong>{{nombre_ciudadano}}</strong>, identificado con Cedula de ciudadania No. <strong>{{identificacion_ciudadano}}</strong>. Por lo expuesto en la parte motiva de este acto.</p>\r\n<p style=\"text-align: justify;\"><strong>ARTICULO TERCERO:</strong> Imponer la multa descrita para el código de infracción <strong>{{codigo_infraccion}}</strong> por valor de <strong>{{valor_comparendo_letras}}&nbsp;PESOS MCTE (${{valor_comparendo}})</strong> equivalente a (<strong>{{smlv}}</strong>) SDMLV, al señor(a) <strong>{{nombre_ciudadano}}</strong>, identificado con Cedula de ciudadania No. <strong>{{identificacion_ciudadano}}</strong>. Como se dejo expreso en la parte motiva de este acto.</p>\r\n<p style=\"text-align: justify;\"><strong>ARTICULO CUARTO:</strong> Remítase copia de la presente resolución al Departamento de Sistemas de el Instituto de Tránsito y Transporte Municipal de Ciénaga Magdalena - INTRACIENAGA para que realice la anotación respectiva e INFORMAR al SIMIT para que efectúe la modificación en su base de datos con fundamento en lo expuesto en la parte motiva de este acto.</p>\r\n<p style=\"text-align: justify;\"><strong>ARTICULO QUINTO: </strong>La presente resolución se notifica en estrados de conformidad a lo establecido en el artículo 139 de la ley 769/2002.</p>\r\n<p style=\"text-align: justify;\">La presente resolución queda notificada en estrados y contra ella no se interpusieron recursos.</p>\r\n<p style=\"text-align: center;\"><strong>NOTIFIQUESE Y CUMPLASE</strong></p>\r\n</div>\r\n<div>\r\n<p>Dada en Cienaga, el día <strong>{{fecha_actual_letras}}</strong>.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>', '', 10, '1', 6, 0, '', 0),
(13, 'Alerta notificaciones', '<p style=\"text-align: center;\"><strong>ACTUALIZACION FECHA NOTIFICACION </strong></p>\r\n<p><strong>Orden de Comparendo No.: 4718900000000{{comparendo}}</strong></p>\r\n<p><strong>C&oacute;digo de Infracci&oacute;n: {{codigo_infraccion}}</strong></p>\r\n<p><strong>Placa: {{placa}}</strong></p>\r\n<p><strong>&nbsp;Fecha de Ocurrencia de los hechos: {{fechayhora_comparendo}}</strong></p>\r\n<p><strong>Lugar de Ocurrencia de los hechos: {{lugar_comparendo}}</strong></p>\r\n<p><strong>&nbsp;Fecha de Notificaci&oacute;n del comparendo: {{fecha_comparendo}}</strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">En el Municipio de {{ciudad_comparendo}}, el d&iacute;a {{fecha_comparendo}}, comparece el se&ntilde;or(a) {{nombre_ciudadano}} , identificado(a) con Cedula de ciudadania No. {{identificacion_ciudadano}} en calidad de propietario y/o conductor del veh&iacute;culo de placas SVD544, quien fue debidamente notificado de la orden de comparendo referenciada, con la finalidad de solicitar actualizaci&oacute;n de fecha notificaci&oacute;n, y su reporte al SIMIT; para iniciar el t&eacute;rmino de descuentos consagrados en el art&iacute;culo 136 de la Ley 769 de 2002. Por medio de la presente queda constancia de haber ejecutado y reportado al SIMIT la actualizaci&oacute;n de fecha de notificaci&oacute;n del comparendo anteriormente referenciado. Nueva Fecha de Notificaci&oacute;n del Comparendo:{{fecha_notificacion_letras}}.</p>', '', 29, '1', 0, 0, '', 0);
